package Tree;import Temp.Temp;import Temp.Label;import java.util.LinkedList;public class MEM extends Exp1 {    public Exp1 exp;    public MEM(Exp1 e) { exp=e; }    public LinkedList<Exp1> kids() {	LinkedList<Exp1> kids = new LinkedList<Exp1>();	kids.addFirst(exp);	return kids;    }    public Exp1 build(LinkedList<Exp1> kids) { return new MEM(kids.getFirst()); }    public void accept(IntVisitor v, int d) { v.visit(this, d); }    public Temp accept(CodeVisitor v) { return v.visit(this); }    public <R> R accept(ResultVisitor<R> v) { return v.visit(this); }}